import * as React from "react";
import PropTypes from "prop-types";
import SwipeableViews from "react-swipeable-views";
import { useTheme } from "@mui/material/styles";
import AppBar from "@mui/material/AppBar";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import { TextField } from "@mui/material";
import { Button } from "@mui/material";
import './style.css'
function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`full-width-tabpanel-${index}`}
      aria-labelledby={`full-width-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired
};

function a11yProps(index) {
  return {
    id: `full-width-tab-${index}`,
    "aria-controls": `full-width-tabpanel-${index}`
  };
}

export default function FullWidthTabs() {
  const theme = useTheme();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleChangeIndex = (index) => {
    setValue(index);
  };
  const handleInputChange = (evento) => {
    console.log(evento.target.value);
  };

  return (
    <Box sx={{ bgcolor: "background.paper", width: '100%' }}>
      <AppBar position="static">
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="secondary"
          textColor="inherit"
          variant="fullWidth"
          aria-label="full width tabs example"
        >
          <Tab label="Itens do Frete" {...a11yProps(0)} />
          <Tab label="Notas Fiscais" {...a11yProps(1)} />
        </Tabs>
      </AppBar>
      <SwipeableViews
        axis={theme.direction === "rtl" ? "x-reverse" : "x"}
        index={value}
        onChangeIndex={handleChangeIndex}
      >
        <TabPanel value={value} index={0} dir={theme.direction}>
        <div className="primeirapart">
          <TextField sx={{ m: 1, width: "30%" }}onChange={handleInputChange}requiredid="outlined-number"label="Total Vomule"type="number"InputLabelProps={{shrink: true}}/>
          <TextField sx={{ m: 1, width: "30%" }}onChange={handleInputChange}requiredid="outlined-number"label="Total Cubagem"type="number"InputLabelProps={{shrink: true}}/>
          <TextField sx={{ m: 1, width: "30%" }}onChange={handleInputChange}required id="outlined-number"label="Total Peso Real"type="number"InputLabelProps={{shrink: true}}/>
          </div> 
          <div className="primeirapart">
          <TextField sx={{ m: 1,width:'12%'}}onChange={handleInputChange} required id="outlined-required" label="Cód Frete"/>
          <TextField sx={{m: 1,width:'30%'}}onChange={handleInputChange} required id="outlined-required" label="Descrição da Carga"/>
          <Button    sx={{m: 1,width:'8%'}} variant="outlined">Buscar</Button>
          <TextField sx={{m: 1,width:'30%'}}onChange={handleInputChange} required id="outlined-required" label="Tipo de Volume"/>
          <Button sx={{m: 1,width:'8%'}} variant="outlined">Buscar</Button>
          </div>
          <div className="primeirapart">
          <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="Qtd Vol"type="number"InputLabelProps={{shrink: true}}/>
          <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="Altura"type="number"InputLabelProps={{shrink: true}}/>
          <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="Largura"type="number"InputLabelProps={{shrink: true}}/>
          <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="comprimento"type="number"InputLabelProps={{shrink: true}}/>
          <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="Peso Cubado"type="number"InputLabelProps={{shrink: true}}/>
          <TextField sx={{ m: 1, width: "15%" }}onChange={handleInputChange}requiredid="outlined-number"label="Peso Real"type="number"InputLabelProps={{shrink: true}}/>
          </div> 
         
          
        </TabPanel>
        <TabPanel value={value} index={1} dir={theme.direction}>
        <div className="primeirapart">
          <TextField sx={{ m: 1,width:'10%'}}onChange={handleInputChange} required id="outlined-required" label="Cód Frete"/>
          <TextField sx={{m: 1,width:'19%'}}onChange={handleInputChange} required id="outlined-required" label="Chave da Nota Fiscal"/>
          <Button    sx={{m: 1,width:'8%'}} variant="outlined">Buscar</Button>
          <TextField sx={{m: 1,width:'9%'}}onChange={handleInputChange} required id="outlined-required" label="Nº NF"/>
          <TextField sx={{m: 1,width:'20%'}}onChange={handleInputChange} required id="outlined-required" label="CNPJ Remetente"/>
          <TextField sx={{m: 1,width:'12%'}}onChange={handleInputChange} required id="outlined-required" label="CNPJ Destino"/>
          </div>
          <div className="div1">
          <TextField sx={{m: 1,width:'30%'}}onChange={handleInputChange} required id="outlined-required" label="Descrição da Carga"/>
          <Button    sx={{m: 1,width:'8%'}} variant="outlined">Buscar</Button>
          </div>
        </TabPanel>
      </SwipeableViews>
    </Box>
  );
}
